INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "春咲 ひより", 0, 0, "お！\nあそこに困ってそうな人発見！", 2, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 0, 1, 0, 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "草野 優衣", 0, 0, "大切な人を\n守れるようになりたい…って", 2, 1, "みんなみたいに\nわたしも強くならなきゃ", 1002, 0, 1, 0, 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "士条 怜", 0, 0, "キミに必要な集中力と感性が", 2, 1, "フェンシングを始めてみては？", 1003, 0, 1, 0, 0, 1, "少しは磨かれると思いますよ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "穂高 みそぎ", 0, 0, "今日はなにして遊ぶ？", 2, 1, "ねぇ、にいちゃん！", 1004, 0, 1, 0, 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "風宮 あかり", 0, 0, "ねぇ…", 2, 1, "風宮あかりです", 1006, 0, 1, 0, 0, 1, "私といっしょに…\nいかない？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "出雲 宮子", 0, 0, "プリンたべたいのー", 2, 1, "出雲宮子なのー", 1007, 0, 1, 0, 0, 1, "食べ物の恨みは怖いのー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "虹村 雪", 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, "ボクは虹村雪。", 1008, 0, 1, 0, 0, 1, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "柊杏奈", 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, "フッ…聞いて後悔するがいい！", 1009, 0, 1, 0, 0, 1, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "姫宮 真歩", 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 0, 1, 0, 0, 1, "ほんまおおきにやわ～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "衣之咲 璃乃", 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, "衣之咲璃乃です！", 1011, 0, 1, 0, 0, 1, "ここで会ったが\n100年目～！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "柏崎 初音", 0, 0, "ち、超能力って…\n何のことかな～？", 2, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 0, 1, 0, 0, 1, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "美波 鈴奈", 0, 0, "一応カリスマ読モJKやってまっす！", 2, 1, "ちょす！\n美波鈴奈だよ～♪", 1016, 0, 1, 0, 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "喜屋武 香織", 0, 0, "東京は遊園地みたいなところさー", 2, 1, "はいたーい。\n喜屋武香織さー。", 1017, 0, 1, 0, 0, 1, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "支倉 伊緒", 0, 0, "先生って呼ばれるのは\nくすぐったいから", 2, 1, "支倉伊緒です。", 1018, 0, 1, 0, 0, 1, "イオちゃんって呼んでね。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "茜 ミミ", 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 0, 1, 0, 0, 1, "ミミをおいてかないでぇ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "栗林 くるみ", 0, 0, "あの……\nふぇ……", 2, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 0, 1, 0, 0, 1, "ふぇぇぇぇぇん……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "風宮 より", 0, 0, "こんな私に貴重な時間を\n割いていただき、", 2, 1, "風宮よりです。\nあああああ！", 1022, 0, 1, 0, 0, 1, "なんてありがとうございます！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "北条 綾音", 0, 0, "おにいちゃんどこいくの？\nえ？", 2, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 0, 1, 0, 0, 1, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "天野 すずめ", 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, "わっ…わっ…私、\n天野すずめといいます！", 1025, 0, 1, 0, 0, 1, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "倉石 恵理子", 0, 0, "あなたは…運命の……\n伴侶……", 2, 1, "……クスクス…私は\n…倉石恵理子……", 1027, 0, 1, 0, 0, 1, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "佐々木 咲恋", 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 0, 1, 0, 0, 1, "…そうでしょ？？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "桜井 望", 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, "桜井望だよ！\nよろしくねっ", 1029, 0, 1, 0, 0, 1, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "ニノン・ジュベール", 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, "デケデケデンっ！", 1030, 0, 1, 0, 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "上喜 しのぶ", 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, "上喜しのぶです。\n手元のドクロが父です。", 1031, 0, 1, 0, 0, 1, "おかしいですね……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "野戸まひる", 0, 0, "けんども\nそれには足りないモンが…", 2, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 0, 1, 0, 0, 1, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "綾瀬 ゆかり", 0, 0, "ちょっと緊張しちゃって…", 2, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 0, 1, 0, 0, 1, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "氷川 鏡華", 0, 0, "知らない人とは話しちゃいけないので", 2, 1, "氷川鏡華…です", 1036, 0, 1, 0, 0, 1, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "柏崎 栞", 0, 0, "……あ、アラーム。", 2, 1, "柏崎…栞です。", 1038, 0, 1, 0, 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "双葉 碧", 0, 0, "私、一人も友達がいなくて……", 2, 1, "ふ、双葉碧です。", 1040, 0, 1, 0, 0, 1, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "三角 千歌", 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, "三角千歌です。", 1042, 0, 1, 0, 0, 1, "そう思っています。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "安芸 真琴", 0, 0, "あぁ？\nお前のそいつの仲間か？", 2, 1, "安芸真琴だ。", 1043, 0, 1, 0, 0, 1, "う、疑ってすまなかったな…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "イリヤ・オーンスタイン", 0, 0, "生けとし生ける全ての者よ！", 2, 1, "わらわこそは夜を総べる者！", 1044, 0, 1, 0, 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "遠見 空花", 0, 0, "ぐふふふふ……はっ！", 2, 1, "そこで騎士は妖精を乱暴に……", 1045, 0, 1, 0, 0, 1, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "宮坂たまき", 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 0, 1, 0, 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "大神 美冬", 0, 0, "それでは早速クエストに…", 2, 1, "大神美冬よ！", 1048, 0, 1, 0, 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "星野静流", 0, 0, "クエストもバトルも\n掃除も洗濯も", 2, 1, "星野静流だよ！", 1049, 0, 1, 0, 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "玉泉美咲", 0, 0, "見ての通りの\nセクシー美少女で", 2, 1, "アタシは玉泉美咲。", 1050, 0, 1, 0, 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, "リマ", 0, 0, "？？？？", 2, 1, "？？？", 1052, 0, 1, 0, 0, 1, "？？？？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "モニカ・ヴァイスヴィント", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。", 1053, 0, 1, 0, 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "ペコリーヌ", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。", 1058, 0, 1, 0, 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "コッコロ", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。", 1059, 0, 1, 0, 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, "キャル", 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。", 1060, 0, 1, 0, 0, 1, "そ、そこまでいうなら\nもらってやる");
